import React, { useState } from 'react';



import {data} from "./constation"



const consultationData = data?.map((item, index) => ({
  id: index + 1,
  date: item.date,
  patientName: item.officerId.patientName,
  patientName: item.officerId,
  consultationType: item.consultationType,
  medicalCondition: item.medicalCondition,
}));


console.log(consultationData,"me")

const FilterComponent = () => {
  const [filters, setFilters] = useState({
    date: '',
    name: '',
    type: '',
    // Add more criteria as needed
  });

  const filteredData = consultationData.filter(item => {
    console.log(consultationData,"filter")
    return (
      item?.date?.includes(filters.date) &&
      item?.patientName?.toLowerCase().includes(filters?.patientName?.toLowerCase()) &&
      item?.consultationType?.toLowerCase().includes(filters?.consultationType?.toLowerCase())
      // Add more filtering conditions for other criteria
    );
  });

  const handleInputChange = e => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  return (
    <div className="p-4">
      <input
        type="text"
        name="date"
        value={filters.date}
        onChange={handleInputChange}
        placeholder="Filter by date"
        className="p-2 mb-2 border border-gray-300 rounded"
      />
      <input
        type="text"
        name="name"
        value={filters.patientName}
        onChange={handleInputChange}
        placeholder="Filter by name"
        className="p-2 mb-2 border border-gray-300 rounded"
      />
      <input
        type="text"
        name="type"
        value={filters.consultationType}
        onChange={handleInputChange}
        placeholder="Filter by type"
        className="p-2 mb-2 border border-gray-300 rounded"
      />
      {/* Add more input fields for other criteria */}
      
      <div className="mt-4">
        {filteredData.map(item => (
          <div key={item.id} className="border p-2 mb-2 rounded">
            <p>Date: </p>
            <p>Name: </p>
            <p>Type: </p>
            {/* Add more data fields */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default FilterComponent;
